import { IconButton } from "@mui/material";
import MoreVertIcon from '@mui/icons-material/MoreVert';


const columnShape = [
  {
    Header: "",
    accessor: "edit",
    Cell: (props) => {
      return (
        <IconButton>
          <MoreVertIcon
            sx={{
              color: "text.disabled",
              fontSize: 18,
            }}
          />
        </IconButton>
      );
    },
  },
  {
    Header: "Nome",
    accessor: "name",
  },
  {
    Header: "CPF",
    accessor: "company",
  },
  {
    Header: "Infopen",
    accessor: "username"
  },
  {
    Header: "Preposto",
    accessor: "email",
  },
  {
    Header: "UF / Penitenciária",
    accessor: "role"
  },
];
export default columnShape;
